      The laboratories are all equipped with modern and latest equipment. Labs function as R&D centers in the school. Teachers and students enjoy the freedom to observe, experiment, analyze and create. Children have a terrific time during practical classes at the Labs! With guidance from the staff, they discuss and exchange different approaches in conducting the practical classes, adopt experimental modes of learning.

The Science Laboratories are well-equipped for classroom instructions. The projects made by students, help in class room instructions. The theory classes are supplemented by a wide range of specimens. An array of slides and jar specimens ranging from bacteria to parasitic or insectivorous plants stimulate the minds of all age groups.
<br>
<br>
The school has the facility of Computer Education. There is a computer laboratory equipped with sufficient number of computers & accessories. The school has a well experienced & qualified full time tutor.
 

The school has provided its students the facility of internet. Every student gets an opportunity to become internet literate. The students gets sufficient time to surf & thus to get in touch with the world.
